import React from 'react'
import './custom-button.style.scss'



const CustomButton = ({children , isGoogleSingIn , ...otherprops}) => {
    return (
      
        <button className={ `${isGoogleSingIn ? 'google-sign-in' : ''} custom-button`} 
        {...otherprops}>
            {children}
        </button>


    )
}

export default CustomButton;
